#!/usr/bin/python3


def reduce(input):
    i = 0

    while i < len(input) - 1:
        if abs(ord(input[i]) - ord(input[i+1])) == differenceAa:
            shortend = input[:i]
            if len(input) > i + 2:
                shortend += input[i+2:]
            input = shortend
            i -= 1
            i = max(0, i)
        else:
            i += 1
    return len(input)


original = ''


differenceAa = ord('a') - ord('A')
minLength = len(original)

for i in range(ord('A'), ord('Z')):
    input = original
    input = input.replace(chr(i), '')
    input = input.replace(chr(i + differenceAa), '')
    minLength = min(minLength, reduce(input))


print(minLength)

